      \r\n$output = drupal_render($content);\r\nprint $output; ','Tin tức + phản hồi + facebook','php_code'),(7,'<div class=\"fb-page\" data-href=\"https://www.facebook.com/facebook\" data-tabs=\"timeline\" data-height=\"200px\" data-small-header=\"false\" data-adapt-container-width=\"true\" data-hide-cover=\"false\" data-show-facepile=\"true\"><blockquote cite=\"https://www.facebook.com/facebook\" class=\"fb-xfbml-parse-ignore\"><a href=\"https://www.facebook.com/facebook\">Facebook</a></blockquote></div>','Facebook like fanpage','php_code'),(8,'<p><img alt=\"\" src=\"/sites/default/files/demovisa.jpg\"></p><p>&nbsp;</p>','Cách thức thanh toán','full_html'),(9,'<div class=\"info\"><strong>Văn phòng SOLOHA</strong><p class=\"place\"><a href=\"/lien-he\">[ Xem thêm đại lý SOLOHA ]</a></p><p class=\"text\">Showroom: Số 573 Giải Phóng, Hà Nội (Có chỗ đỗ ô tô, xe máy rộng rãi miễn phí)<br>Email: cco@soloha.vn - Điện thoại: (04) 63.29.7777 Fax: (04) 62.78.59.58<br><em>Copyright © 2013 Soloha.vn</em></p> <a href=\"https://plus.google.com/u/0/106702726079091807133/posts\" rel=\"author\" style=\"color: #999999;\">Google+ - Soloha Việt Nam</a></div>','Address','full_html'),(10,'<p>Thiết kế web bởi oms</p>','design by','full_html'),(11,'<?php\r\n$tid=arg(2);\r\n$level1=bootstrap_taxomony_get_root_parent($tid);\r\n$level2 = taxonomy_get_children($level1->tid);\r\necho \'<ul class=\"menu-level level-1\">\';\r\necho \'<li>\';\r\necho \'<a title=\"\'.$level1->name.\'\" href=\"\'.url(\'taxonomy/term/\'.$level1->tid).\'\">\'.$level1->name.\'</a>\';\r\nif($level2){\r\n    echo \'<ul class=\" level-2\">\';\r\n    foreach($level2 as $l2) {\r\n        echo \'<li>\';\r\n        echo \'<a title=\"\' . $l2->name . \'\" href=\"\' . url(\'taxonomy/term/\' . $l2->tid) . \'\">\' . $l2->name . \'</a>\';\r\n        $level3 = taxonomy_get_children($l2->tid);\r\n        if ($level3) {\r\n            echo \'<ul class=\"level-3\">\';\r\n            foreach ($level3 as $l3) {\r\n                echo \'<li>\';\r\n                echo \'<a title=\"\' . $l3->name . \'\" href=\"\' . url(\'taxonomy/term/\' . $l3->tid) . \'\">\' . $l3->name . \'</a>\';\r\n                echo \'</li>\';\r\n            }\r\n            echo \'</ul>\';\r\n        }\r\n        echo \'</li>\';\r\n    }\r\n    echo \'</ul>\';\r\n}\r\necho \'</li>\';\r\necho \'</ul>\';\r\n        echo \'</li>\';\r\necho \'</ul>\';','Danh mục con','php_code');
