INSERT INTO `cache_field` VALUES ('field:node:10','a:2:{s:4:\"body\";a:1:{s:3:\"und\";a:1:{i:0;a:5:{s:5:\"value\";s:4020:\"<div>&nbsp;</div><div><p class=\"rtecenter\"><img alt=\"thiết kế và hoàn thiện nội thất phòng khách nhà chị duyên 01\" src=\"http://solohaplaza.com/sites/default/files/baiviet27/chi-duyen-10.jpg\" style=\"height:399px; width:600px\"><br><br><span style=\"color:rgb(0, 0, 0); font-family:arial,verdana,sans-serif; font-size:14px\">&nbsp;Với nội thất chung cư, các mẫu thiết kế phòng khách thường tích hợp với phòng ăn mang đến sự tiện dụng trong cuộc sống</span></p><p>&nbsp;</p><p class=\"rtecenter\"><img alt=\"Thiết kế và hoàn thiện nội thất nhà chị Duyên\" src=\"http://solohaplaza.com/sites/default/files/baiviet27/chi-duyen-12.jpg\" style=\"height:399px; width:600px\"><br>Trang trí cho thêm cho phòng khách với những kệ giá sách nhỏ ghim vào tường</p><p class=\"rtecenter\"><img alt=\"thiết kế và hoàn thiện nội thất 03\" src=\"http://solohaplaza.com/sites/default/files/baiviet27/chi-duyen-13.jpg\" style=\"height:400px; width:600px\"><br><br>Thảm trải sàn luôn đi cùng với bộ bàn ghế sofa</p><p class=\"rtecenter\"><img alt=\"hoàn thiện nội thất 04\" src=\"http://solohaplaza.com/sites/default/files/baiviet27/chi-duyen-11.jpg\" style=\"height:399px; opacity:0.9; width:600px\"><br>Giấy dán tường &nbsp;mang đến nét mới cho không gian phòng khách</p><p class=\"rtecenter\"><img alt=\"hoàn thiện nội thất 05\" src=\"http://solohaplaza.com/sites/default/files/baiviet27/chi-duyen-15.jpg\" style=\"height:399px; width:600px\"><br>&nbsp;</p><p class=\"rtecenter\"><img alt=\"hoàn thiện nội thất nhà chị Duyên 07\" src=\"http://solohaplaza.com/sites/default/files/baiviet27/chi-duyen-14.jpg\" style=\"height:601px; width:400px\"></p><p class=\"rtecenter\">&nbsp;</p><p class=\"rtecenter\"><img alt=\"hoàn thiện nội thất nhà chị Duyên 07\" src=\"http://solohaplaza.com/sites/default/files/baiviet27/chi-duyen-04.jpg\" style=\"height:400px; width:600px\"></p><p class=\"rtecenter\"><img alt=\"\" src=\"http://solohaplaza.com/sites/default/files/baiviet27/chi-duyen-05.jpg\" style=\"height:392px; width:600px\"></p><p class=\"rtecenter\"><img alt=\"\" src=\"http://solohaplaza.com/sites/default/files/baiviet27/chi-duyen-06.jpg\" style=\"height:399px; opacity:0.9; width:600px\"><br><br>Những vật dụng nhỏ trang trí cho phòng khách</p><p class=\"rtecenter\"><img alt=\"\" src=\"http://solohaplaza.com/sites/default/files/baiviet27/chi-duyen-08.jpg\" style=\"height:399px; width:600px\"></p><p>&nbsp;<span style=\"font-family:arial,verdana,sans-serif; font-size:14px\">Trong khi đó khu bếp có diện tích nhỏ, sử dụng mẫu tủ bếp chữ I đơn giản cho không gian.</span></p><p class=\"rtecenter\"><img alt=\"\" src=\"http://solohaplaza.com/sites/default/files/baiviet27/chi-duyen-09.jpg\" style=\"height:601px; width:400px\"></p><p class=\"rtecenter\">&nbsp;</p><p>&nbsp;</p><p class=\"rtecenter\"><img alt=\"\" src=\"http://solohaplaza.com/sites/default/files/baiviet27/chi-duyen-16.jpg\" style=\"height:399px; width:600px\"><br><br><span style=\"color:rgb(0, 0, 0); font-family:arial,verdana,sans-serif; font-size:14px\">&nbsp;Nội thất phòng ngủ tạo ấn tượng với màu gỗ nổi bật không gian và kết hợp với giấy dán tường trang trí &nbsp;</span></p><p>&nbsp;&nbsp;</p><p class=\"rtecenter\"><img alt=\"\" src=\"http://solohaplaza.com/sites/default/files/baiviet27/chi-duyen-02.jpg\" style=\"height:399px; width:600px\"><br><br><span style=\"color:rgb(0, 0, 0); font-family:arial,verdana,sans-serif; font-size:14px\">Tủ quần áo to rộng để chứa được nhiều đồ.</span>&nbsp;</p><p class=\"rtecenter\"><img alt=\"\" src=\"http://solohaplaza.com/sites/default/files/baiviet27/chi-duyen-03.jpg\" style=\"height:399px; width:600px\"></p><p><span style=\"font-size:14px\">Soloha cảm ơn chị Duyên và gia đình đã chọn Soloha làm đơn vị thiết kế và thi công.</span></p><p><span style=\"font-size:14px\">Chúc chị và gia đình sức khỏe và hạnh phúc !</span></p></div>\";s:7:\"summary\";s:0:\"\";s:6:\"format\";s:13:\"filtered_html\";s:10:\"safe_value\";s:957:\"<p>  Với nội thất chung cư, các mẫu thiết kế phòng khách thường tích hợp với phòng ăn mang đến sự tiện dụng trong cuộc sống Trang trí cho thêm cho phòng khách với những kệ giá sách nhỏ ghim vào tườngThảm trải sàn luôn đi cùng với bộ bàn ghế sofaGiấy dán tường  mang đến nét mới cho không gian phòng khách  Những vật dụng nhỏ trang trí cho phòng khách Trong khi đó khu bếp có diện tích nhỏ, sử dụng mẫu tủ bếp chữ I đơn giản cho không gian.   Nội thất phòng ngủ tạo ấn tượng với màu gỗ nổi bật không gian và kết hợp với giấy dán tường trang trí    Tủ quần áo to rộng để chứa được nhiều đồ. Soloha cảm ơn chị Duyên và gia đình đã chọn Soloha làm đơn vị thiết kế và thi công.Chúc chị và gia đình sức khỏe và hạnh phúc !</p>\n\";s:12:\"safe_summary\";s:0:\"\";}}}s:11:\"field_image\";a:1:{s:3:\"und\";a:1:{i:0;a:13:{s:3:\"fid\";s:2:\"33\";s:3:\"uid\";s:1:\"1\";s:8:\"filename\";s:16:\"chi-duyen-10.jpg\";s:3:\"uri\";s:37:\"public://field/image/chi-duyen-10.jpg\";s:8:\"filemime\";s:10:\"image/jpeg\";s:8:\"filesize\";s:5:\"85522\";s:6:\"status\";s:1:\"1\";s:9:\"timestamp\";s:10:\"1480553750\";s:11:\"rdf_mapping\";a:0:{}s:3:\"alt\";s:0:\"\";s:5:\"title\";s:0:\"\";s:5:\"width\";s:3:\"960\";s:6:\"height\";s:3:\"639\";}}}}',0,1480861496,1),('field:node:11','a:2:{s:4:\"body\";a:1:{s:3:\"und\";a:1:{i:0;a:5:{s:5:\"value\";s:4020:\"<div>&nbsp;</div><div><p class=\"rtecenter\"><img alt=\"thiết kế và hoàn thiện nội thất phòng khách nhà chị duyên 01\" src=\"http://solohaplaza.com/sites/default/files/baiviet27/chi-duyen-10.jpg\" style=\"height:399px; width:600px\"><br><br><span style=\"color:rgb(0, 0, 0); font-family:arial,verdana,sans-serif; font-size:14px\">&nbsp;Với nội thất chung cư, các mẫu thiết kế phòng khách thường tích hợp với phòng ăn mang đến sự tiện dụng trong cuộc sống</span></p><p>&nbsp;</p><p class=\"rtecenter\"><img alt=\"Thiết kế và hoàn thiện nội thất nhà chị Duyên\" src=\"http://solohaplaza.com/sites/default/files/baiv