INSERT INTO `field_data_body` VALUES ('node','product',0,2,2,'und',0,'<p>Ghế sofa GSF32</p>','','filtered_html'),('node','product',0,3,3,'und',0,'<p>Ghế sofa GSF32</p>','','filtered_html'),('node','product',0,4,4,'und',0,'<p>Ghế sofa GSF32</p>','','filtered_html'),('node','product',0,5,5,'und',0,'<p>Ghế sofa GSF32</p>','','filtered_html'),('node','product',0,6,6,'und',0,'Ghế sofa GSF32','','filtered_html'),('node','product',0,7,7,'und',0,'<p>Ghế sofa GSF32</p>','','filtered_html'),('node','article',0,10,10,'und',0,'<div>&nbsp;</div><div><p class=\"rtecenter\"><img alt=\"thiết kế và hoàn thiện nội thất phòng khách nhà chị duyên 01\" src=\"http://solohaplaza.com/sites/default/files/baiviet27/chi-duyen-10.jpg\" style=\"height:399px; width:600px\"><br><br><span style=\"color:rgb(0, 0, 0); font-family:arial,verdana,sans-serif; font-size:14px\">&nbsp;Với nội thất chung cư, các mẫu thiết kế phòng khách thường tích hợp với phòng ăn mang đến sự tiện dụng trong cuộc sống</span></p><p>&nbsp;</p><p class=\"rtecenter\"><img alt=\"Thiết kế và hoàn thiện nội thất nhà chị Duyên\" src=\"http://solohaplaza.com/sites/default/files/baiviet27/chi-duyen-12.jpg\" style=\"height:399px; width:600px\"><br>Trang trí cho thêm cho phòng khách với những kệ giá sách nhỏ ghim vào tường</p><p class=\"rtecenter\"><img alt=\"thiết kế và hoàn thiện nội thất 03\" src=\"http://solohaplaza.com/sites/default/files/baiviet27/chi-duyen-13.jpg\" style=\"height:400px; width:600px\"><br><br>Thảm trải sàn luôn đi cùng với bộ bàn ghế sofa</p><p class=\"rtecenter\"><img alt=\"hoàn thiện nội thất 04\" src=\"http://solohaplaza.com/sites/default/files/baiviet27/chi-duyen-11.jpg\" style=\"height:399px; opacity:0.9; width:600px\"><br>Giấy dán tường &nbsp;mang đến nét mới cho không gian phòng khách</p><p class=\"rtecenter\"><img alt=\"hoàn thiện nội thất 05\" src=\"http://solohaplaza.com/sites/default/files/baiviet27/chi-duyen-15.jpg\" style=\"height:399px; width:600px\"><br>&nbsp;</p><p class=\"rtecenter\"><img alt=\"hoàn thiện nội thất nhà chị Duyên 07\" src=\"http://solohaplaza.com/sites/default/files/baiviet27/chi-duyen-14.jpg\" style=\"height:601px; width:400px\"></p><p class=\"rtecenter\">&nbsp;</p><p class=\"rtecenter\"><img alt=\"hoàn thiện nội thất nhà chị Duyên 07\" src=\"http://solohaplaza.com/sites/default/files/baiviet27/chi-duyen-04.jpg\" style=\"height:400px; width:600px\"></p><p class=\"rtecenter\"><img alt=\"\" src=\"http://solohaplaza.com/sites/default/files/baiviet27/chi-duyen-05.jpg\" style=\"height:392px; width:600px\"></p><p class=\"rtecenter\"><img alt=\"\" src=\"http://solohaplaza.com/sites/default/files/baiviet27/chi-duyen-06.jpg\" style=\"height:399px; opacity:0.9; width:600px\"><br><br>Những vật dụng nhỏ trang trí cho phòng khách</p><p class=\"rtecenter\"><img alt=\"\" src=\"http://solohaplaza.com/sites/default/files/baiviet27/chi-duyen-08.jpg\" style=\"height:399px; width:600px\"></p><p>&nbsp;<span style=\"font-family:arial,verdana,sans-serif; font-size:14px\">Trong khi đó khu bếp có diện tích nhỏ, sử dụng mẫu tủ bếp chữ I đơn giản cho không gian.</span></p><p class=\"rtecenter\"><img alt=\"\" src=\"http://solohaplaza.com/sites/default/files/baiviet27/chi-duyen-09.jpg\" style=\"height:601px; width:400px\"></p><p class=\"rtecenter\">&nbsp;</p><p>&nbsp;</p><p class=\"rtecenter\"><img alt=\"\" src=\"http://solohaplaza.com/sites/default/files/baiviet27/chi-duyen-16.jpg\" style=\"height:399px; width:600px\"><br><br><span style=\"color:rgb(0, 0, 0); font-family:arial,verdana,sans-serif; font-size:14px\">&nbsp;Nội thất phòng ngủ tạo ấn tượng với màu gỗ nổi bật không gian và kết hợp với giấy dán tường trang trí &nbsp;</span></p><p>&nbsp;&nbsp;</p><p class=\"rtecenter\"><img alt=\"\" src=\"http://solohaplaza.com/sites/default/files/baiviet27/chi-duyen-02.jpg\" style=\"height:399px; width:600px\"><br><br><span style=\"color:rgb(0, 0, 0); font-family:arial,verdana,sans-serif; font-size:14px\">Tủ quần áo to rộng để chứa được nhiều đồ.</span>&nbsp;</p><p class=\"rt